import React from 'react';
import logo from './svg/logo.svg';
import './App.css';
import Home from './pages/home';

function App() {
  return (
    <div className="App">
      <Home/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome!
        </p>
          <a
            className="App-link"
            href="https://google.com"
            target="_blank"
            rel="noopener noreferrer"
          >
          Link
        </a>
      </header>
    </div>
  );
}

export default App;
